package main

import (
	"fmt"
	"strconv"
	"strings"
)

func main() {
	passwords := strings.Split(Puzzle, "\n")
	countValid := 0

	for _, passwordEntry := range passwords {
		countValid += checkValid(passwordEntry)
	}

	fmt.Printf("Total Valid Passowrds: %d\n", countValid)
}

func checkValid(passwordEntry string) int {
	values := strings.Split(passwordEntry, ": ")
	password := values[1]

	restrictions := strings.Split(values[0], " ")
	targetChar := restrictions[1][0]

	targetVals := strings.Split(restrictions[0], "-")
	firstPos, _ := strconv.Atoi(targetVals[0])
	secondPos, _ := strconv.Atoi(targetVals[1])

	firstChar := password[firstPos-1]
	secondChar := password[secondPos-1]

	if (firstChar == targetChar || secondChar == targetChar) && firstChar != secondChar {
		return 1
	} else {
		return 0
	}
}

